import React, { useState } from "react";
import CopyrightIcon from '@material-ui/icons/Copyright';

const Notes = (props)=>{

    const deleteFun = ()=>{

        props.onpress(props.id);
    }
   
    return(
                         <>

                         <div className="Notes" >
                            <h1 style={{marginLeft:"20px" }}>{props.value.text}</h1>

                            <p  style={{ marginLeft:"20px" }} >{props.value.content}</p>

                            <button style={{ marginLeft:"20px" }} onClick={deleteFun}> Delete </button>
                         </div>
                        
                        </>);

}

export default Notes;
